INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (401, "2030/12/17 14:59:59", 10046, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 2, "2020/07/31 12:00:00", 24, "アヤネ", 24001, 0.0, 2, 0.0, 102301);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (402, "2030/12/17 14:59:59", 10046, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2.21, 1, "2020/07/31 12:00:00", 24, "アヤネ", 24002, 0.0, 2, 0.0, 102301);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (403, "2030/12/17 14:59:59", 10046, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 2, "2020/07/31 12:00:00", 24, "アヤネ", 24003, 0.0, 2, 0.0, 102301);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (701, "2030/12/17 14:59:59", 10046, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1.99, 2, "2020/07/31 12:00:00", 24, "アサヒ", 24004, 0.0, 1, 0.0, 192201);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (702, "2030/12/17 14:59:59", 10046, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2.21, 1, "2020/07/31 12:00:00", 24, "アサヒ", 24005, 0.0, 2, 0.0, 192201);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (703, "2030/12/17 14:59:59", 10046, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 3.33, 2, "2020/07/31 12:00:00", 24, "アサヒ", 24006, 0.0, 1, 0.0, 192201);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (801, "2030/12/17 14:59:59", 10046, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 2, "2020/07/31 12:00:00", 24, "部員３", 24007, 0.0, 2, 0.0, 192301);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (802, "2030/12/17 14:59:59", 10046, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2.68, 1, "2020/07/31 12:00:00", 24, "部員３", 24008, 0.0, 2, 0.0, 192301);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (803, "2030/12/17 14:59:59", 10046, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 2, "2020/07/31 12:00:00", 24, "部員３", 24009, 0.0, 2, 0.0, 192301);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (501, "2030/12/17 14:59:59", 10046, "やった！", 0.0, 1, "2020/07/31 12:00:00", 24, "", 24010, 0.0, 1, 0.0, 192501);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (502, "2030/12/17 14:59:59", 10046, "勝ったよ！", 0.0, 1, "2020/07/31 12:00:00", 24, "", 24011, 0.0, 1, 0.0, 192501);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (503, "2030/12/17 14:59:59", 10046, "いい調子！", 0.0, 1, "2020/07/31 12:00:00", 24, "", 24012, 0.0, 1, 0.0, 192501);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (111, "2030/12/17 14:59:59", 10046, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 5.33, 6, "2020/07/31 12:00:00", 24, "ミサト", 24013, 0.0, 2, 0.0, 113501);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (112, "2030/12/17 14:59:59", 10046, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 6.85, 1, "2020/07/31 12:00:00", 24, "ミサト", 24014, 0.0, 2, 0.0, 113501);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (113, "2030/12/17 14:59:59", 10046, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 3.0, 1, "2020/07/31 12:00:00", 24, "ミサト", 24015, 0.0, 2, 0.0, 113501);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (611, "2030/12/17 14:59:59", 10046, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 6.11, 1, "2020/07/31 12:00:00", 24, "ダイチ", 24016, 0.0, 2, 0.0, 192401);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (612, "2030/12/17 14:59:59", 10046, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 6.75, 1, "2020/07/31 12:00:00", 24, "ダイチ", 24017, 0.0, 2, 0.0, 192401);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (613, "2030/12/17 14:59:59", 10046, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 2, "2020/07/31 12:00:00", 24, "ダイチ", 24018, 0.0, 2, 0.0, 192401);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (211, "2030/12/17 14:59:59", 10046, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 4.52, 2, "2020/07/31 12:00:00", 24, "ハツネ", 24019, 0.0, 1, 0.0, 113401);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (212, "2030/12/17 14:59:59", 10046, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 3.89, 2, "2020/07/31 12:00:00", 24, "ハツネ", 24020, 0.0, 1, 0.0, 113401);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (213, "2030/12/17 14:59:59", 10046, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 13.49, 1, "2020/07/31 12:00:00", 24, "ハツネ", 24021, 0.0, 2, 0.0, 113401);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (311, "2030/12/17 14:59:59", 10046, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 3.17, 1, "2020/07/31 12:00:00", 24, "カヤ", 24022, 0.0, 2, 0.0, 106501);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (312, "2030/12/17 14:59:59", 10046, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 4.42, 1, "2020/07/31 12:00:00", 24, "カヤ", 24023, 0.0, 2, 0.0, 106501);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (313, "2030/12/17 14:59:59", 10046, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 2.89, 6, "2020/07/31 12:00:00", 24, "カヤ", 24024, 0.0, 1, 0.0, 106501);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (421, "2030/12/17 14:59:59", 10046, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3.71, 4, "2020/07/31 12:00:00", 24, "アヤネ", 24025, 0.0, 3, 0.0, 102301);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (721, "2030/12/17 14:59:59", 10046, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 5.1, 2, "2020/07/31 12:00:00", 24, "アサヒ", 24026, 0.0, 1, 0.0, 192201);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (821, "2030/12/17 14:59:59", 10046, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 4.34, 1, "2020/07/31 12:00:00", 24, "部員３", 24027, 0.0, 3, 0.0, 192301);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (521, "2030/12/17 14:59:59", 10046, "いい勝負だったよ\nまたやろうね", 0.0, 1, "2020/07/31 12:00:00", 24, "", 24028, 0.0, 1, 0.0, 192501);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (101, "2030/12/17 14:59:59", 10046, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 5.62, 1, "2020/07/31 12:00:00", 24, "ミサト", 24029, -360.0, 2, 0.0, 113501);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (102, "2030/12/17 14:59:59", 10046, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 9.58, 1, "2020/07/31 12:00:00", 24, "ミサト", 24030, -360.0, 2, 0.0, 113501);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (103, "2030/12/17 14:59:59", 10046, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 2, "2020/07/31 12:00:00", 24, "ミサト", 24031, -360.0, 2, 0.0, 113501);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (104, "2030/12/17 14:59:59", 10046, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 9.13, 2, "2020/07/31 12:00:00", 24, "ミサト", 24032, -360.0, 1, 0.0, 113501);
INSERT INTO `v1_0dde03f7d3a18236e8b384e3f7db262e441086ccd8bd935a31ef6f42b2045863` VALUES (105, "2030/12/17 14:59:59", 10046, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 8.27, 1, "2020/07/31 12:00:00", 24, "ミサト", 24033, -360.0, 2, 0.0, 113501);
